var app=angular.module('pdfapp',[]);
app.controller('pdfcont',function($scope,$http)
{
    $scope.pdf=function(pdfs)
    {
        var doc=new jsPDF()
        var img="data:image/png;base64,"
        doc.addImage(img, 'jpeg',0,15, 210, 270); /*img,typw,left,bottom,flow right side,*/
        doc.text($scope.pdfs.name,130,73)/*name,margin-left,*/
        doc.text($scope.pdfs.experience,130,100)
        doc.text($scope.pdfs.place,130,128)
        doc.text($scope.pdfs.cmt,25,180)
        doc.setTextColor("black");
        // doc.addFontSize(1);
        doc.setFontType("bold");
        doc.save('feedback.pdf')

        console.log($scope.pdfs);
        $http({
        method : 'POST',
        url : '/postpdf',
        data : $scope.pdfs
        }).then(function success(response){
        alert('PDF Generated succesfully');
        $scope.pdfcoll.push(response.data);
        $scope.pdfs = {};
        }, function error(response){
        alert('Error occured, please try again');
        })
    }
})


   